import React from 'react';
import Header from './Header';
import Button from './Buttons';
import About from './About';
import Interest from './Interests';
import Footer from './About copy';


export default function App(){
    return(
        <div>
            <Header />
            <Button />
            <About />
            <Interest />
            <Footer />
        </div>

    )

}
